@BOUmerang2018 @AwoodRadio Btw, that was zero Cardi shade, b/c good parents want their child/ren to be w/whoever makes them happy (w/in reason, lol).
Olivia seems sweet n lovely, but more importantly adores their son and only wants him to be happy, sometimes to her own detriment. 
WTF else could you want?

@HellsRainbow Alastor lets out a chuckle and his cheeks turn a shade of pink from her actions. He smiles and takes her own hand back, placing a kiss back to her own hand as well!

"I'm glad, I enjoyed it very much, my little lovely princess~."

He winked and leaned in to kiss her cheek
